import React, { Component } from 'react'

export default class About extends Component {
    render() {
        return (
            <section id="about">
                <h1>Hej, I'm Vivien.</h1>
                <p>I’m a sun-seeker, roamer and coffee enthusiast. </p>
                <p>Okay, let’s get serious now. I’m a UI and UX designer based in Stockholm. I’m currently doing a master’s degree in User Experience and Interactive Media Design at Södertörn University. 
</p>
                <p>Want to work with me? <strong>Let’s have a coffee.</strong> </p>
                <img src={require('./images/IMG_1433.JPG')} width='400' height='500'></img>
            </section>
        )
    }
}
